import checkBoxReducer from "./reducer";

export const all = state => state.checkboxes

export function getCheckBoxState(checkbox_id, checkbox_state) {
    return state =>
        state.checkBoxReducer.checkboxes[checkbox_id] ||
        checkbox_state ||
        false;
}
